INSERT INTO `examinations` (`id`, `category_id`, `poster`, `name`, `description`, `instruction`, `price`, `status`, `created_at`, `updated_at`) VALUES (9, 6, 'examinations/1698812922_r_m_i_b2023.png', 'RMIB 2023', NULL, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"737\" style=\"width: 553pt;\"><colgroup><col width=\"737\" style=\"width: 553pt;\"></colgroup><tbody><tr height=\"320\" style=\"height: 240pt;\"><td height=\"320\" class=\"xl63\" width=\"737\" style=\"padding-top: 1px; padding-right: 1px; padding-left: 1px; font-size: 11pt; font-family: Calibri, sans-serif; vertical-align: middle; border-width: initial; border-style: none; border-color: initial; height: 240pt; width: 553pt;\">Bayangkan Anda dikelompokkan dengan sebelas orang mahasiswa <font class=\"font5\" style=\"font-size: 11pt; font-weight: 700;\">WANITA </font><font class=\"font0\" style=\"font-size: 11pt;\">dalam proyek \"Wisma Kerja Nyata\" (disingkat WKN), yang bertujuan menyadari makna Kelestarian Lingkungan Hidup (KLH). Perjalanan akan berlangsung ke beberapa tempat.<br><br>Di tempat - tempat tertentu tim atau \"keduabelasan\" Anda akan mengerjakan proyek dan mendapat bantuan ahli - ahli yang akan membimbing dan melatih anggota - anggota tim bila diperlukan. Perusahaan \"Supra Motor\" telah bersedia menjadi sponsor kegiatan ini.<br><br>Setiap ada kegiatan tim, anggota - anggota membagi tugas sesuai dengan kesediaan masing - masing. Caranya adalah : sakikan daftar tugas, kemudian setiap anggota mengurutkan tygas yang paling ia senangi sampai tugas yang paling tidak ia senangi, tidak peduli apakah masing - masing mampu melakukannya (sebab akan dilatih). Yang penting adalah minat dan kesediaan Anda melakukan tugas - tugas tersebut. Urutkan pilihan tugas, mulai dari yang paling Anda senangi (nomor1), nomor 2 Anda senangi, nomor 3, dan seterusnya, sampai pilihan paling akhir nomor 12, ialah yang paling tidak Anda senangi. kemudian teliti kembali, jangan sampai ada yang Anda lewati, sebab keberhasilan WKN ini sangat tergantung pada kesadaran anggota.</font></td></tr></tbody></table>', 0.00, 'On Going', '2023-11-01 04:25:36', '2023-11-01 04:28:42');
