INSERT INTO `scripts` (`id`, `category_id`, `sub_category_id`, `example_id`, `title`, `description`, `type`, `example_question`, `created_at`, `updated_at`) VALUES (15, 1, 2, NULL, 'Subtes 2 : Wourtauswahl/Melengkapi kata-kata (WA)', '<p>PETUNJUK DAN CONTOH UNTUK KELOMPOK SOAL 02</p><p>(Soal-soal 21-40)</p><p>Ditentukan lima kata. Pada 4 dari 5 kata itu terdapat suatu kesamaan. Carilah satu kata yang tidak memiliki kesamaan dengan keempat kata yang lain.</p><p><br></p><p>Contoh:</p><p>a. meja</p><p>b. kursi</p><p>c. burung</p><p>d. lemari</p><p>e. tempat tidur</p><p>Meja, kursi, lemari, dan tempat tidur adalah perabot rumah, sedangkan burung\" bukanlah perabot</p><p>rumah yang tidak memiliki kesamaan dengan keempat kata yang lain. Jawaban yang benar adalah :</p><p>burung Oleh karena itu pada kertas jawaban, pilih jawaban c. burung</p><div><br></div>', 'Single', 0, '2023-09-04 08:38:10', '2023-09-06 07:14:22');
